import CardList from './CardList'; // Calling the Card Template
import {robots} from './robots'; // import robot.js





const App = () => {
    return ( <
        div >
        <
        h1 > Robot Friends < /h1> <
        SearchBox / >
        <
        CardList robots = {
            robots
        }
        /> <
        /div>

    );
}

export default App;
